def num_ways_to_fill(n):
    """
    Return the number of ways to fill a 3xn board with 2x1 dominoes.
    """
    if n == 0:
        return 1  # There is only one way to fill a 3x0 board (with no dominoes)

    ways = 0
    for i in range(n):
        # For each possible position for the first domino
        for j in range(3):
            # For each possible orientation of the first domino
            for k in range(2):
                # Recursively count the number of ways to fill the rest of the board
                ways += num_ways_to_fill(n-1)

    return ways

def count_dominoes(n):
    # Base case: If the board is empty, there is only one way to fill it with 2x1 dominoes - by not placing any dominoes at all
    if n == 0:
        return 1

    # Recursive case: For each cell in the row, we can either place a domino or not place a domino.
    // Since we are filling a 3xn board with 2x1 dominoes, we have 2 options for the first cell:
    //  1. Place a domino that covers two cells
    //  2. Don't place a domino and leave two empty cells
    // For the remaining n-1 cells, we also have 2 options for each cell:
    //  1. Place a domino that covers one cell
    //  2. Don't place a domino and leave one empty cell
    // This gives us a total of 2 * (2^n) possibilities
    return 2 * pow(2, n)

