def inversions(tuples):
    """
    Returns a list of tuples of the form (a, b) where a and b are elements of tuples
    and a > b.
    """
    inversions = []
    for t in tuples:
        for i in range(len(t) - 1):
            if t[i] > t[i + 1]:
                inversions.append((t[i], t[i + 1]))
    return inversions

