def most_common_words(dictionary):
    """
    Return a list of the most common words in a dictionary.
    """
    # Create a dictionary to store the counts of each word
    word_counts = {}

    # Iterate over the dictionary and count the occurrences of each word
    for word in dictionary:
        if word in word_counts:
            word_counts[word] += 1
        else:
            word_counts[word] = 1

    # Sort the word counts in descending order
    sorted_word_counts = sorted(word_counts.items(), key=lambda x: x[1], reverse=True)

    # Return the most common words
    return [word for word, count in sorted_word_counts]

